--
-- Definition of trigger `trg_siparisler_ek_b`
--

DROP TRIGGER /*!50030 IF EXISTS */ `trg_siparisler_ek_b`;

DELIMITER $$

CREATE DEFINER = `marinboat`@`%` TRIGGER `trg_siparisler_ek_b` BEFORE INSERT ON `tbl_siparisler` FOR EACH ROW BEGIN
    SET NEW.tarih = NOW();
   SET NEW.no =
          (SELECT IF(MAX(id) <=> NULL,
                     1,
                     CONCAT(DATE_FORMAT(CURDATE(), '%d%m%y'),
                            '-',
                            NEW.kullanici_id,
                            '-',
                            LAST_INSERT_ID() + 1))
             FROM `shop2`.`tbl_siparisler` USE INDEX ( id ));
END $$

DELIMITER ;

--
-- Definition of trigger `trg_siparisler_ek_a`
--

DROP TRIGGER /*!50030 IF EXISTS */ `trg_siparisler_ek_a`;

DELIMITER $$

CREATE DEFINER = `marinboat`@`%` TRIGGER `trg_siparisler_ek_a` AFTER INSERT ON `tbl_siparisler` FOR EACH ROW BEGIN 
  IF ((SELECT
         COUNT(t.id)
       FROM
         `shop2`.`tbl_siparisler_durumlar` t
         USE INDEX (siparis_id )
       WHERE
         t.siparis_id = NEW.id AND
         siparis_durum_id = 1) = 0)
  THEN
      `shop2`.`tbl_siparisler_durumlar`(
        siparis_id,
        siparis_durum_id)
    VALUES
      (
        NEW.id,
        1);

  `shop2`.`tbl_siparisler_durumlar`(
    siparis_id,
    siparis_durum_id)
VALUES
  (
    NEW.id,
    (CASE NEW.odeme_sekli_id
       WHEN 1 THEN 2
       WHEN 2 THEN 3
       WHEN 4 THEN 2
       WHEN 5 THEN 3
       WHEN 6 THEN 2
     END));

  END IF;
END $$

DELIMITER ;

