INSERT INTO `tbl_headerlar` (`id`,`dil_id`,`baslik`,`text`,`resim`,`onay`,`admin_id_ek`,`tarih_ek`,`admin_id_gun`,`tarih_gun`) VALUES 
 (1,999,'MARİN BOAT`UN SÜRAT TUTKUNU MODELLERİ','1975 yılından kurulan Marin Boat, motoryat katekgorinden yeni modeller üretmeye devam ediyor. 3,5 metreden 10 metreye kadar olan modellerinden yılda 500 adet üretim yapan Marin Boat, ayrıca dünyaca ünlü markaların bölge bayiliğini yapıyor. Markanın yeni dönem hedefi ise 14 metrelik yeni bir modelin tasarımına imza atmak ve deniz motoru ithal etmek.','1.jpg',1,999,NULL,999,'2012-11-19 22:17:56'),
 (2,999,'MARİN BOAT`UN EN ÇOK TERCİH EDİLENİ CABRİO 8.05','8 metre uzunluğa sahip Cabrio, Marin Boat markasının en çok tercih edilen modelleri arasında. Modelle adeta özdeşleşmiş olan sarı renk ise hız tutkunları için ideat bir seçenek olarak dikkat çekiyor.','2.jpg',1,999,NULL,999,'2012-11-19 22:21:19');
