 (2,'D','deneme@deneme.com','555555555555555','<br/>Sizlere sundugumuz hizmet kalitesinin gelistirilmesi sizlerden aldigimiz öneri, görüs ve elestirilerin degerlendirilmesiyle dogru orantili olarak gelismektedir. <br/><br/>Sürekli gelisim sürecimize destek olacak öneri ve beklentilerinizi bizlerle paylasmanizdan memnuniyet duyacagiz. <br/><br/>Mesajlariniz tarafimizdan titizlikle incelenecek ve alinacak aksiyonlara temel olusturacaktir. Sizlerin beklentilerini ve memnuniyetini arttirarak, \"%100 müsteri memnuniyeti\" anlayisimizi birlikte daha ileriye tasimak dilegiyle.','2012-03-13 02:54:47',1,999,'2012-03-13 02:57:54'),
 (3,'H&#252;seyin Yıldırım','huseyinyildirim@hotmail.com','5436063222','denemedir','2012-05-06 21:45:31',0,NULL,NULL),
 (4,'ALI UMBAYOĞULLARI','ali_umbay2203@hotmail.com','0505 778 29 15','4.05 fiber tekneyi almak istiyoruz bizi ararmısınız...','2012-11-15 11:29:06',0,NULL,NULL),
 (5,'BURAK ŞENSOY','buket-baris@hotmail.com','05445686378','telefon numaranızı bulamadım bana donmenızı beklıyorum','2012-11-21 20:14:20',0,NULL,NULL),
 (6,'ATILLA IMECE','atilla3566@hotmail.de','05447290858','Merhaba bu samba5,30 u begendim bunun motorlu fiyati ne olur tekne arti motor seceneklerinin fiyati hakkinda bilgilendirirseniz sevinirim ayrica birde rom&#246;rk fiyati istiyorum bu tekne icin hoscakalin gorusmek uzere hayirli isler','2012-12-13 19:29:33',0,NULL,NULL),
 (7,'BASRI AKAR','basriakar17@hotmail.com','05415661900','poyraz kamaralı 4.80 model tekne i&#231;in sitenizde detaylı resim g&#246;remedim. &#252;yelik linkide problem var sanırım.bu &#252;r&#252;n&#252;n gelibolu adresine teslimatı ne kadar s&#252;rer. standart aksesuar yanında g&#252;neş tentesi kapama brandası ve katlanır merdiven ile birlikte adrese teslim nakit &#246;demeli olursa veya bonus 12 taksit olursa fiyatı ne kadar olur.','2012-12-17 17:23:45',0,NULL,NULL),
 (8,'VOLKAN PARALI','vparali1970@yahoo.com','5335673663','4 metre tekne ve 9.9 mercury motor almak istiyorum.Yazlığım Bandırma-Edincik de.Buraya da teslimat &#252;cretsiz mi? Şimdi alsak teslimat Haziran ayında olabilir mi?','2012-12-27 19:07:14',0,NULL,NULL);
