 (25,999,25,'MARİN BOAT HAKKINDA',1,999,'2012-11-03 14:45:29',999,'2012-10-22 03:04:46'),
 (26,999,26,'Fiberglass ürünler, inboard - outboard deniz motorları alanında ki 25 yıllık geçmişi ve yeni girdiği trailer ve tekne römorku üretimi ile marin boat , Fiberglass Tekne yat ve motoryat ürünlerini yüksek kalite de üreterek yurtiçi ve yurtdışında satışa sunmaktadır. Marin Boat yapmış olduğu adrese teslim hizmet ve taksit imkanı ile herkesi tekne sahibi yapmayı amaçlıyor ve bunu başarıyor.\n<br/><br/>\nKullanılan malzemelerin yüksek kaliteye sahip olması, tüm ürünlerimiz, sorunsuz bir şekilde kullanımına sebep olmaktadır.',1,999,'2012-11-03 14:45:29',999,'2012-10-22 03:07:18'),
