 (237,999,233,'<p> <strong>ÜYELİK           SÖZLEŞMESİ</strong></p>\r\n<p> <strong>1.           Taraflar</strong></p>\r\n<p> <strong>a)</strong> <a href=\"http://www.hepsiburada.com/\">www.marinboat.com</a>  internet sitesinin faaliyetlerini           yürüten Atatük Mh. Mustafa Kemal Paşa Cd. Ata Sk. No:5 İstanbul adresinde mukim Marin Boat Denizcilik Ltd. Şti. (Bundan böyle &ldquo;Marin Boat&rdquo; olarak anılacaktır).</p>\r\n<p> <strong>b)</strong> <a href=\"http://www.hepsiburada.com/\">www.marinboat.com</a>  internet sitesine üye olan internet           kullanıcısı (&quot;Üye&quot;)</p>\r\n<p> <strong>2.           Sözleşmenin Konusu</strong></p>\r\n<p> İşbu           Sözleşme&rsquo;nin konusu Marin Boat\'ın sahip olduğu internet sitesi <a href=\"http://www.hepsiburada.com/\">www.marinboat.com</a> &lsquo;dan üyenin faydalanma şartlarının           belirlenmesidir.</p>\r\n<p> <strong>3.           Tarafların Hak ve Yükümlülükleri</strong></p>\r\n<p> <strong>3.1.</strong> Üye, <a href=\"http://www.hepsiburada.com/\">www.marinboat.com</a>  internet sitesine üye olurken verdiği           kişisel ve diğer sair bilgilerin kanunlar önünde doğru olduğunu, Marin Boat\'ın           bu bilgilerin gerçeğe aykırılığı nedeniyle uğrayacağı tüm zararları aynen ve           derhal tazmin edeceğini beyan ve taahhüt eder.</p>\r\n<p> <strong>3.2.</strong> Üye, Marin Boat           tarafından kendisine verilmiş olan şifreyi başka kişi ya da kuruluşlara veremez,           üyenin söz konusu şifreyi kullanma hakkı bizzat kendisine aittir. Bu sebeple           doğabilecek tüm sorumluluk ile üçüncü kişiler veya yetkili merciler tarafından           Marin Boat\'a karşı ileri sürülebilecek tüm iddia ve taleplere karşı,           Marin Boat\'ın sözkonusu izinsiz kullanımdan kaynaklanan her türlü tazminat ve           sair talep hakkı saklıdır.</p>\r\n<p> <strong>3.3.</strong> Üye <a href=\"http://www.hepsiburada.com/\">www.marinboat.com</a>  internet sitesini kullanırken yasal           mevzuat hükümlerine riayet etmeyi ve bunları ihlal etmemeyi baştan kabul ve           taahhüt eder. Aksi takdirde, doğacak tüm hukuki ve cezai yükümlülükler tamamen           ve münhasıran üyeyi bağlayacaktır.</p>\r\n<p> <strong>3.4.</strong> Üye, <a href=\"http://www.hepsiburada.com/\">www.marinboat.com</a>  internet sitesini hiçbir şekilde kamu           düzenini bozucu, genel ahlaka aykırı, başkalarını rahatsız ve taciz edici           şekilde, yasalara aykırı bir amaç için, başkalarının fikri ve telif haklarına           tecavüz edecek şekilde kullanamaz. Ayrıca, üye başkalarının hizmetleri           kullanmasını önleyici veya zorlaştırıcı faaliyet (spam, virus, truva atı, vb.)           ve işlemlerde bulunamaz.</p>\r\n<p> <strong>3.5.</strong> <a href=\"http://www.hepsiburada.com/\">www.marinboat.com</a>  internet sitesinde üyeler tarafından           beyan edilen, yazılan, kullanılan fikir ve düşünceler, tamamen üyelerin kendi           kişisel görüşleridir ve görüş sahibini bağlar. Bu görüş ve düşüncelerin           Marin Boat\'la hiçbir ilgi ve bağlantısı yoktur. Marin Boat\'ın üyenin beyan           edeceği fikir ve görüşler nedeniyle üçüncü kişilerin uğrayabileceği zararlardan           ve üçüncü kişilerin beyan edeceği fikir ve görüşler nedeniyle üyenin           uğrayabileceği zararlardan dolayı herhangi bir sorumluluğu bulunmamaktadır.</p>\r\n<p> <strong>3.6.</strong> Marin Boat, üye           verilerinin yetkisiz kişilerce okunmasından ve üye yazılım ve verilerine           gelebilecek zararlardan dolayı sorumlu olmayacaktır. Üye, <a href=\"http://www.hepsiburada.com/\">www.marinboat.com</a>  internet sitesinin kullanılmasından           dolayı uğrayabileceği herhangi bir zarar yüzünden Marin Boat\'dan tazminat talep           etmemeyi peşinen kabul etmiştir.</p>\r\n<p> <strong>3.7.</strong> Üye, diğer           internet kullanıcılarının yazılımlarına ve verilerine izinsiz olarak ulaşmamayı           veya bunları kullanmamayı kabul etmiştir. Aksi takdirde, bundan doğacak hukuki           ve cezai sorumluluklar tamamen üyeye aittir.</p>\r\n<p> <strong>3.8.</strong> İşbu üyelik           sözleşmesi içerisinde sayılan maddelerden bir ya da birkaçını ihlal eden üye           işbu ihlal nedeniyle cezai ve hukuki olarak şahsen sorumlu olup, Marin Boat\'ı           bu ihlallerin hukuki ve cezai sonuçlarından ari tutacaktır. Ayrıca; işbu ihlal           nedeniyle, olayın hukuk alanına intikal ettirilmesi halinde, Marin Boat\'ın           üyeye karşı üyelik sözleşmesine uyulmamasından dolayı tazminat talebinde           bulunma hakkı saklıdır.</p>\r\n<p> <strong>3.9.</strong> Marin Boat\'ın           her zaman tek taraflı olarak gerektiğinde üyenin üyeliğini silme, müşteriye ait           dosya, belge ve bilgileri silme hakkı vardır. Üye iş bu tasarrufu önceden kabul           eder. Bu durumda, Marin Boat\'ın hiçbir sorumluluğu yoktur.</p>\r\n<p> <strong>3.10.</strong> <a href=\"http://www.hepsiburada.com/\">www.marinboat.com</a>  internet sitesi yazılım ve tasarımı           Marin Boat mülkiyetinde olup, bunlara ilişkin telif hakkı ve/veya diğer fikri           mülkiyet hakları ilgili kanunlarca korunmakta olup, bunlar  üye tarafından izinsiz kullanılamaz,           iktisap edilemez ve değiştirilemez. Bu web sitesinde adı geçen başkaca şirketler           ve ürünleri sahiplerinin ticari markalarıdır ve ayrıca fikri mülkiyet hakları           kapsamında korunmaktadır.</p>\r\n<p> <strong>3.11.</strong> Marin Boat           tarafından <a href=\"http://www.hepsiburada.com/\">www.marinboat.com</a>  internet sitesinin iyileştirilmesi,           geliştirilmesine yönelik olarak ve/veya yasal mevzuat çerçevesinde siteye           erişmek için kullanılan İnternet servis sağlayıcısının adı ve Internet Protokol           (IP) adresi, Siteye erişilen tarih ve saat, sitede bulunulan sırada erişilen           sayfalar ve siteye doğrudan bağlanılmasını sağlayan Web sitesinin Internet           adresi gibi bir takım bilgiler toplanabilir.</p>\r\n<p> <strong>3.12.</strong> Marin Boat           kullanıcılarına daha iyi hizmet sunmak, ürünlerini ve hizmetlerini iyileştirmek,           sitenin kullanımını kolaylaştırmak için kullanımını kullanıcılarının özel           tercihlerine ve ilgi alanlarına yönelik çalışmalarda üyelerin kişisel           bilgilerini kullanabilir. Marin Boat, üyenin <a href=\"http://www.hepsiburada.com/\">www.marinboat.com</a>  internet sitesi üzerinde yaptığı           hareketlerin kaydını bulundurma hakkını saklı tutar.</p>\r\n<p> <strong>3.13.</strong> Marin Boat\'a üye olan kişi, yürürlükte bulunan           ve/veya yürürlüğe alınacak uygulamalar kapsamında Marin Boat iştiraki olan tüm şirketler tarafından  kendisine ürün ve hizmet           tanıtımları, reklamlar, kampanyalar, avantajlar, anketler  ve diğer müşteri           memnuniyeti uygulamaları sunulmasına izin verdiğini beyan ve kabul eder.  Üye,           Marin Boat\'a üye olurken ve/veya başka yollarla geçmişte vermiş olduğu ve/veya           gelecekte vereceği kişisel ve alışveriş bilgilerinin ve alışveriş ve/veya           tüketici davranış bilgilerinin  yukarıdaki amaçlarla toplanmasına, DOL            iştiraki olan tüm şirketler ile paylaşılmasına, Marin Boat iştiraki           olan tüm şirketler tarafından kullanılmasına ve arşivlenmesine izin verdiğini           beyan ve kabul eder. Üye aksini bildirmediği sürece  üyeliği sona erdiğinde de            verilerin toplanmasına, Marin Boat iştiraki olan tüm şirketler ile paylaşılmasına,           Marin Boat iştiraki olan tüm şirketler tarafından kullanılmasına ve           arşivlenmesine izin verdiğini beyan ve kabul eder. Üye aksini bildirmediği            sürece Marin Boat iştiraki olan tüm şirketlerin  kendisi ile            internet, telefon, SMS,  vb iletişim kanalları kullanarak irtibata geçmesine           izin verdiğini beyan ve kabul eder. Üye yukarıda bahsi geçen bilgilerin           toplanması,  paylaşılması, kullanılması, arşivlenmesi ve kendisine erişilmesi           nedeniyle doğrudan ve/veya dolaylı maddi ve/veya manevi menfi ve/veya müsbet,           velhasıl herhangi bir zarara uğradığı konusunda talepte bulunmayacağını ve           Marin Boat iştiraki olan şirketleri sorumlu tutmayacağını beyan ve kabul           eder. Üye veri paylaşım tercihlerini değiştirmek isterse, bu talebini           Marin Boat\'ın müşteri hizmetleri çağrı merkezlerine  iletebilir.</p>\r\n<p> <strong>3.14.</strong> Marin Boat,           üyenin kişisel bilgilerini yasal bir zorunluluk olarak istendiğinde veya (a)           yasal gereklere uygun hareket etmek veya Marin Boat\'a tebliğ edilen yasal           işlemlere uymak; (b) Marin Boat ve Marin Boat web sitesi ailesinin haklarını           ve mülkiyetini korumak ve savunmak için gerekli olduğuna iyi niyetle kanaat           getirdiği hallerde açıklayabilir.</p>\r\n<p> <strong>3.15.</strong> Marin Boat web           sitesinin virus ve benzeri amaçlı yazılımlardan arındırılmış olması için mevcut           imkanlar dahilinde tedbir alınmıştır. Bunun yanında nihai güvenliğin sağlanması           için kullanıcının, kendi virus koruma sistemini tedarik etmesi ve gerekli           korunmayı sağlaması gerekmektedir. Bu bağlamda üye Marin Boat web sitesi\'ne           girmesiyle, kendi yazılım ve işletim sistemlerinde oluşabilecek tüm hata ve           bunların doğrudan yada dolaylı sonuçlarından kendisinin sorumlu olduğunu kabul           etmiş sayılır.</p>\r\n<p> <strong>3.16.</strong> Marin Boat,           sitenin içeriğini dilediği zaman değiştirme, kullanıcılara sağlanan herhangi bir           hizmeti değiştirme yada sona erdirme veya Marin Boat web sitesi\'nde kayıtlı           kullanıcı bilgi ve verilerini silme hakkını saklı tutar.</p>\r\n<p> <strong>3.17.</strong> Marin Boat,           üyelik sözleşmesinin koşullarını hiçbir şekil ve surette ön ihbara ve/veya           ihtara gerek kalmaksızın her zaman değiştirebilir, güncelleyebilir veya iptal           edebilir. Değiştirilen, güncellenen yada yürürlükten kaldırılan her hüküm ,           yayın tarihinde tüm üyeler bakımından hüküm ifade edecektir.</p>\r\n<p> <strong>3.18.</strong> Taraflar,           Marin Boat\'a ait tüm bilgisayar kayıtlarının tek ve gerçek münhasır delil           olarak, HUMK madde 287\'ye uygun şekilde esas alınacağını ve söz konusu           kayıtların bir delil sözleşmesi teşkil ettiği hususunu kabul ve beyan eder.</p>\r\n<p> <strong>3.19.</strong> Marin Boat, iş bu üyelik sözleşmesi           uyarınca, üyelerinin kendisinde kayıtlı elektronik posta adreslerine           bilgilendirme mailleri ve cep telefonlarına bilgilendirme SMS&rsquo;leri gönderme           yetkisine sahip olmakla beraber, üye işbu üyelik sözleşmesini onaylamasıyla           beraber bilgilendirme maillerinin elektronik posta adresine ve bilgilendirme           SMS&rsquo;lerinin cep telefonuna gönderilmesini kabul etmiş sayılacaktır. Üye mail           ve/veya SMS almaktan vazgeçmek istemesi durumunda &ldquo;Benim Sayfam&rdquo; bölümündeki           &ldquo;Tercihlerim&rdquo; kısmından mail ve/veya SMS gönderim iptal işlemini           gerçekleştirebilecektir.</p>\r\n<p> <strong>4.           Sözleşmenin Feshi</strong></p>\r\n<p> İşbu sözleşme           üyenin üyeliğini iptal etmesi veya Marin Boat tarafından üyeliğinin iptal           edilmesine kadar yürürlükte kalacaktır. Marin Boat üyenin üyelik sözleşmesinin           herhangi bir hükmünü ihlal etmesi durumunda üyenin üyeliğini iptal ederek           sözleşmeyi tek taraflı olarak feshedebilecektir.</p>\r\n<p> <strong>5.           İhtilaflerin Halli</strong></p>\r\n<p> İşbu sözleşmeye           ilişkin ihtilaflerde İstanbul Mahkemeleri ve İcra Daireleri yetkilidir.</p>\r\n<p> <strong>6.           Yürürlük</strong></p>\r\n<p> Üyenin, üyelik           kaydı yapması üyenin üyelik sözleşmesinde yer alan tüm maddeleri okuduğu ve           üyelik sözleşmesinde yer alan maddeleri kabul ettiği anlamına gelir. İşbu           Sözleşme üyenin üye olması anında akdedilmiş ve karşılıklı olarak yürürlülüğe girmiştir.</p>',1,999,'2012-11-03 14:45:29',NULL,NULL),
