 (240,999,236,'<p><strong>SATIŞ SÖZLEŞMESİ</strong></p>\r\n<p><strong>A- TARAFLAR:</strong></p>\r\n<p>I- Satıcı : Marin Moat</p>\r\n<p>Adres : Atatürk Mh. Mustafa Kemal Paşa Cd. Atam Sk. No:3 İstanbul</p>\r\n<p>Kısaca : SATICI</p>\r\n<p>II- Alıcı : Adres :</p>\r\n<p>Kısaca : ALICI</p>\r\n<p><strong>B- KAPSAM VE SÜRE:</strong></p>\r\n<p>1) SATICI ile ALICI arasındaki aksi yazılı olarak kararlaştırılmayan tüm ticari ilişki ve işlemler, bu sözleşme hükümlerine tabidir.Bu sözleşme taraflar arasında daha önce sözleşmelere bağlanan ve/veya sözleşme olmaksızın gerçekleşen tüm ticari ilişki ve işlemlere de uygulanır.</p>\r\n<p>2) Bu sözleşme, taraflardan birisi tarafından gönderilen sözleşmenin feshine ilişkin ihbarın, muhataba ulaşmasına kadar geçerlidir.Ayrıca, ALICI’nın, herhangi bir borcunu gününde ödememesi ve/veya ALICI’ya SATICI tarafından keşide edilen poliçenin ademi kabul ve ademi tediyeden protesto edilmiş olması halinde, işbu sözleşme, hiçbir ihtar gerekmeksizin kendiliğinden feshedilmiş olacak ve SATICI’ya, bakiye alacağını tahsil için, ALICI aleyhine yasal yollara başvurma hakkını bahsedecektir.Ancak, işbu sözleşme hükümleri, feshe rağmen, SATICI’nın alacağı ödeninceye kadar uygulanacaktır.</p>\r\n<p><strong>C- SATIŞLAR:</strong></p>\r\n<p>1) Taraflar arasındaki, satışa konu emtianın, cinsi, kalitesi, miktarı, tutarı, ödeme şekli ve varsa özel şartlarını içeren sipariş belgeleri, özel bağlantı teklif belgeleri, sipariş mektupları, müşteri siparişi teyidi, faturalar ve yazılı özel anlaşmalar, bu sözleşmenin ayrılmaz parçası sayılır.Sözkonusu belgeler ile özel olarak düzenlenmeyen konularda, işbu sözleşme şarları geçerlidir.</p>\r\n<p>2) Taraflar arasında yazılı olarak kararlaştırılmamış ise satış konusu emtianın satış fiyatı fatura tarihinde SATICI’nın cari satış fiyatıdır.SATICI, fatura ve/veya teslim edilmemiş emtianın fiyat ve satış şartlarını ihbarsız değiştirebilir.</p>\r\n<p>3) Bu sözleşme, satışlar ve satışlarla ilgili tüm belgelerden ve kıymetli evraktan kaynaklanan tüm giderler ile vergi, resim ve harçların sorumluluğu ALICI’ya aittir ve ALICI tarafından ödenecektir.</p>\r\n<p><strong>D- BELGE VE ÖDEMELER I- ÖDEMELER</strong></p>\r\n<p>1) SATICI ve ALICI arasındaki ticari ilişki ve işlemlerden doğan hak ve borçların gününde ifası esastır.</p>\r\n<p>2) ALICI, satışa konu emtia bedelleri ile sair hususlardan doğan borçlarını, bunlara ait irsaliye ve/veya faturanın tanzimi anında, SATICI’nın kabul edeceği ödeme şekilleri ile kabul edilmez ise nakden kapatacaktır.</p>\r\n<p>3) Taraflar arasındaki bütün tediyelerin ispatı, imzalı makbuzla yapılmış olmasına bağlıdır.</p>\r\n<p>4) ALICI’nın ödemeleri, öncelikle SATICI’ya olan vade farkı ve temerrüt faizi borçalrına mahsup edilir.Nakten veya çek ile yapılan ödemeler, SATICI’nın doğmuş ve doğacak vade farkı ve temerrüt faizi alacaklarından vazgeçtiğini göstermez ve SATICI’nın bunları ALICI’dan talep hakları saklıdır.</p>\r\n<p>5) Fatura bedeli; mal bedeli ve/veya kur farkı, vade farkı ile temerrüt faizine uyuglanacak KDV’den oluşur.</p>\r\n<p>6) SATICI tarafından yapılan satışların bedelleri, ALICI tarafından vadeli ödenecek ise SATICI’nın tayin ve tespit ettiği şekilde ALICI’nın teminata bağlanması halinde vadeli satış mümkündür.</p>\r\n<p>7) Teminat olarak alınan kıymetlerin gerektirdiği masraflar esas itibariyle ALICI’ya aittir.SATICI uygun gördüğü taktirde bunların tamamını veya bir kısmını üstlenip üstlenmemekte serbesttir.ALICI’nın bu konuda herhangi bir talepte bulunma hakkı yoktur.</p>\r\n<p>8) ALICI’nın gösterdiği teminatlar SATICI tarafından yeterli bulunmadığı taktirde, SATICI, ALICI’nın vereceği siparişleri kabul edip etmemekte serbesttir.ALICI’nın bu konuda herhangi bir talepte bulunma hakkı yoktur.</p>\r\n<p>9) ALICI, borçlarına karşılık SATICI’nın yazılı kabülü ve vade farkı ayrıca hesaplanmak ve ödenmek üzere ve TTK’na göre düzenlemiş ve vergise keşide eden tarafından ödenmiş çek ve/veya bonoları SATICI’ya ciro ederek verebilir.SATICI, ALICI tarafından ciro edilen çeklerin postada veya bankada veya herhangi bir şekilde kaybından veya yok olmasından sorumlu tutulamaz.</p>\r\n<p>10) ALICI tarafından, SATICI’ya verilen kambiyo senetlerinin gününde tahsil edilmemesi veya herhangi bir nedenle zayii halinde, bunların turarı ile yapılan masrafları ve ödeme tarihine kadar %7 oranında temerrüt faizi, SATICI’nın ihbarı üzerine, nakden ve def’aten ödenir.Bu ihbarın, herhangi bir nedenler gecikmesinin sorumluluğu, nakit ödeme yerine kambiyo senedi veren ALICI’ya aittir.</p>\r\n<p>11) ALICI’nın keşide veya ciro edilerek SATICI’ya verdiği çek ve bonoların günlerinde ödenmemesi durumunda, bunların bedelleri SATICI’nın ilk ihbarında ALICI tarafından, vade gününden itibaren vade farkları da eklenerek SATICI’ya ödenecektir.Aksi halde, bu borç dahil ALICI’nın, SATICI’ya olan tüm borçları müeccel hale gelecektir.</p>\r\n<p>12) Harp, çatışma, dahili kargaşa, işgal, sabotaj, grev, lokavt, işçi ve memur direnişi, sel, deprem, yangın, ham veya yarımamul madde, yarı mamul madde ve malzeme ithal veya dahili piyasadan temininin mümkün olmaması, enerji kısıtlaması gibi SATICI’nın ihtiyarında olmayan sebeplerle satış akdinin SATICI tarafından yerine getirilmemesi/getirilememesi ve bunlarla sınırlı olmamak üzere kanunen kabul edilen sair mücbir sebep hallerinde, SATICI’nın ALICI’ya karşı hiçbir sorumluluğu yoktur.</p>\r\n<p><strong>II- HESAPLARIN KAPATILMASI VE VADE FARKLARI</strong></p>\r\n<p>1) SATICI’nın ALICI’ya kestiği her fatura, faturada belirtilen sürede, bedeli nakten ve/veya SATICI’nın yazılı kabülüne bağlı olmak üzere bu sözleşmede, belirtilen nitelikte çek ve/veya bonolarla kapatılır.Bono ve/veya çek verilerek kapatılan fatura bedellerinde, faturada belirtilen ödeme gününün aşılması halinde aylık %7 oranında vade farkı uygulanır.</p>\r\n<p>2) Hesapların, ALICI tarafından süresinde kapatılmaması halinde, ALICI’nın SATICI’ya senet ve/veya çekle kapatılmış olanlarda dahil, tüm borçları ve vade farkları, SATICI’nın herhangi bir ihbarına gerek olmaksızın müeccel olur.</p>\r\n<p>3) ALICI geciken ödemeleri için SATICI’ya aylık %7 vade farkı ödemeyi kabul etmiştir.</p>\r\n<p>4) ALICI’nın SATICI’ya verdiği çek ve bonoların ALICI’ya iade edilmiş olması, bunların bedellerinin ödendiğine dair SATICI tarafından düzenlenmiş ve imzalanmış bir makbuz olmadıkça, bedellerinin, masraflarının ve vade farklarının SATICI’ya ödendiğini ve SATICI’nın bunlardan vazgeçtiğini göstermez.</p>\r\n<p><strong>III- DEĞİŞİKLİKLER VE FESİH</strong></p>\r\n<p>1) Sözleşme ve temerrüt faizi oranlarında değişiklikler, SATICI tarafından yazılı olarak ALICI’ya iadeli mektupla gönderildiği tarihten itibaren uygulanır.Bu faiz oranlarını kabul etmeyen ALICI, borçlarını nakten ve def’aten ödemek zorundadır.Yeni faiz oranının yazılı olarak bildirilmediği hallerde faturada belirtilmemiş ise bu sözleşmede belirtilen %7 faiz oranı uygulanır.</p>\r\n<p>2) ALICI’nın, bu sözleşme hükümlerine aykırı davranışı halinde SATICI tüm haklarının ifasını ve alacaklarının ödenmesini ALICI’dan derhal talep hakkında sahiptir ve ALICI buna uymak zorundadır.Buna uyulmadığı taktirde SATICI’nın ALICI’daki tüm hak ve alacakları herhangi bir ihbara gerek kalmaksızın muaccel hale gelir.</p>\r\n<p>3) Taraflardan birisinin, TTK hükümlerine göre diğer tarafa yapacağı yazılı ihbar ile sözleşm feshedilir.Kim tarafından feshedilirse edilsin ALICI tüm borçlarını SATICI’ya nakden ve def’aten ödemek zorundadır.</p>\r\n<p><strong>E- GENEL HÜKÜMLER:</strong></p>\r\n<p><strong>I- İHBAR, İHTAR, TEYİD VE ADRES DEĞİŞİKLİKLERİ</strong></p>\r\n<p>1) Taraflar arasındaki her türlü ihbar, ihtar ve teyitler ile bunlara karşı itirazlar; telgraf, iadeli taahhütlü mektup veya noter aracılığı ile yapılır.</p>\r\n<p>2) Taraflar, adres değişikliklerini diğer tarafa 7(yedi) gün içerisinde yazılı olarak ihbar zorundadır.Bu ihbar yapılmadığı taktirde, sözleşmede mevcut adrese gönderilen tebligatlat, hukuken geçerli bir tebligatın tüm hukuki sonuçlarını doğuracaktır.</p>\r\n<p><strong>II- YETKİLİLERİN DEĞİŞMESİ VE DEVİR</strong></p>\r\n<p>1) ALICI, kendisini temsile yetkili şahıslar değiştiği taktirde bu durumu SATICI’ya anında bildirmek ve hazırlanan yeni imza sirkülerini tebliğ etmek zorundadır.ALICI, aksine davrandığı bu davranışının sonuçlarına katlanacaktır.</p>\r\n<p>2) Bu sözleşme, tarafların bütün kanuni ve akdi haleflerini bağlar ve akdi ve kanuni halefleri leh ve aleyhine hüküm ifade eder.ALICI sözleşme konusu işi ve doğacak haklarını SATICI’nın yazılı izni olmaksızını herhangi bir başkasına devir ve temlik edemez.</p>\r\n<p><strong>III- SÖZLEŞMENİN DEĞİŞİMİ VE İHTİLAF HALLERİ</strong></p>\r\n<p>1) Bu anlaşma ancak, tarafların yetkili mercilerince imzalanan ek sözleşme ile değiştirilebilir.Sürekli uygulamalar dahi, yazılı ve imzalı bir değişiklik yok ise, sözleşmenin değiştirildiği anlamında yorumlanamaz ve bu tür uygulamalar dayanılarak herhangi bir hak iddia edilemez.</p>\r\n<p>2) Bu sözleşmeden kaynaklanan ya da sözleşme ile ilgili ihtilafların halinde, HUMK</p>\r\n<p>287. maddesi gereğince SATICI’nın defter, kayıt ve belegeleri yegane delil ve İstanbul Mahkemeleri ve İcra Daireleri, münhasıran yetkili kabul edilmiştir. İşbu sözleşme tüm ekleriyle bir bütündür ve .................. tarihinde iki nüsha olarak tanzim ve taraflarca okunduktan sonra imza edilmiştir.</p>\r\n<p>SATICI / ALICI</p>',1,999,'2012-11-03 14:45:29',NULL,NULL),
