 (244,999,240,'<p><strong>Gizlilik Politikası</strong></p>\r\n<p>www.marinboat.com adresinden alışveriş yapmak için kayıt olmanız gerekmektedir. Kayıt olurken kullandığınız kişisel bilgiler (ad, soyad, kullanıcıadı, e-posta adresi, posta adresi, kredi kartı bilgileri, satın aldıklarınız vb.) kesinlikle başka kişi ve kuruluşlara verilmez. Bu bilgiler sizlere daha iyi hizmet verebilmemiz amacıyla kullanılır. Bilgileriniz yüksek güvenlik düzeyinde çalışan sunucularımızda, firma ürün veritabanının korunduğu sistemde tutulmaktadır.</p>\r\n<p>www.marinboat.com Globalsign sertifika ve lisansına sahiptir. Yaptığınız tüm işlemler 128 bit şifreleme ile gerçekleşmektedir. Sistemimize kaydettiğiniz kişisel bilgilerinize sadece siz ulaşabilir ve siz değiştirebilirsiniz. Başka birinin sizinle ilgili bilgilere ulaşması ve bunları değiştirmesi mümkün değildir.</p>\r\n<p>İstediğiniz zaman sitemize üyeliğinizi iptal edebilirsiniz.</p>\r\n<p>Üyeliğinizi sildiğinizde tüm kişisel bilgileriniz veritabanımızdan silinir. </p>\r\n',1,999,'2012-11-03 14:45:29',999,'2012-05-02 23:59:29'),
